> Political John Boehner's here to stay, for now, with nothing to lose In this Oct. 7, 2015, photo, outgoing House Speaker John Boehner of Ohio listens at right as House Majority Leader Kevin McCarthy of Calif., speaks during a new conference on Capitol Hill in Washington. Boehner wants out. He really does. But the Ohio House Republican is staying put, for now _ and that could improve the chances for a debt limit increase by early next month to avoid a market-shattering government default and possibly a bipartisan budget deal to head off a government shutdown in December. Conservative hardliners have already forced Boehner to announce he’s leaving and then caused further chaos by blocking the ascension of McCarthy. (AP Photo/Evan Vucci) 
